    useEffect(
        ()=>{
            getData()  
        },[]
    )
    const getData= async()=>{
        const response= await getUsers();
        console.log(response.data);
        setUsers(response.data)
    }

    return (
        <div>
            <Link to="/adduser" className="btn btn-primary mt-3">Add New User</Link>
            <h1>this is user list</h1>
        </div>
    )
}
